double radial_function(double radius) {
  const double delta = 3.815549652351027E-6;
  double r = radius/delta;
  return pow(1+r*r, +0.5);
}

double distance(double x1[], double x2[]) {
  double sum = 0.0;
  double a;
  int i;
  for (i=0; i<71; i++) {
    a = x1[i]-x2[i];
    sum += a*a;
  }
  return sqrt(sum);
}

